import React from 'react'

class Todo extends React.Component {

    style = () => {
        const { complete } = this.props.todo
        return { textDecoration: complete ? 'line-through': 'none' }
    }

    render() {

        console.log(this.props.todo)
        return (
            <h3 className='text-center bg-light border-bottom' style={this.style()}>
                <i className='far fa-times-circle fa-sm float-left m-1 text-danger ' ></i>{this.props.todo.title }
                <input type='checkbox' className='m-2 float-right'/>
            </h3>
        )
    }
}

export default Todo
